import { yellow } from "@mui/material/colors";
import React, { useState } from "react";

const Wrapcont = () => {
  const [isHovereditem, setIsHovereditem] = useState(false);
  const [isHoveredyear, setIsHoveredyear] = useState(false);
  const [isHoveredslide, setIsHoveredslide] = useState(false);

  const handleMouseEnterItem = () => {
    if (!isHovereditem) {
      setIsHovereditem(true);
    }
  };
  const handleMouseEnterYear = () => {
    if (!isHoveredyear) {
      setIsHoveredyear(true);
    }
  };
  const handleMouseEnterSlide = () => {
    if (!isHoveredslide) {
      setIsHoveredslide(true);
    }
  };

  const handleMouseLeaveItem = () => {
    if (isHovereditem) {
      setIsHovereditem(false);
    }
  };
  const handleMouseLeaveYear = () => {
    if (isHovereditem) {
      setIsHovereditem(false);
    }
  };
  const handleMouseLeaveSlide = () => {
    if (isHoveredslide) {
      setIsHoveredslide(false);
    }
  };

  const item = {
    fontSize: "1.4rem",
    fontFamily: "GTWalsheimProTrial",
    color: "#000000",
    visibility: "visible",
    outline: "none",
    boxSizing: "border-box",
    padding: 0,
    margin: 0,
    WebkitFontSmoothing: "antialiased",
    WebkitTapHighlightColor: "rgba(0, 0, 0, 0)",
    flex: 1,
    height: "357px",
    background: "#f5f5f5",
    position: "relative",
    cursor: "pointer",
    border: "2px solid #fff",
    transition: "all 0.4s",
  };
  const hoverItemStyle = {
    fontSize: "1.4rem",
    fontFamily: "GTWalsheimProTrial",
    color: "#000000",
    visibility: "visible",
    outline: "none",
    boxSizing: "border-box",
    padding: 0,
    margin: 0,
    WebkitFontSmoothing: "antialiased",
    WebkitTapHighlightColor: "rgba(0, 0, 0, 0)",
    height: "357px",
    position: "relative",
    cursor: "pointer",
    border: "2px solid #fff",
    transition: "all 0.4s",
    flex: 7.5,
    background: "#219ed9",
  };

  //const [ItemStyles, setItemStyles] = useState(item);

  //const ItemStyles = isHovered ? hoverItemStyle : item;

  const year = {
    visibility: "visible",
    cursor: "pointer",
    outline: "none",
    boxSizing: "border-box",
    padding: 0,
    margin: 0,
    WebkitFontSmoothing: "antialiased",
    WebkitTapHighlightColor: "rgba(0, 0, 0, 0)",
    transition: "all 0.4s",
    textAlign: "center",
    paddingTop: "31px",
    fontSize: "24px",
    fontFamily: "GTWalsheimProTrial",
    fontWeight: 400,
    color: "#000000",
    lineHeight: 1,
    opacity: 0.6,
  };
  const yearHovered = {
    visibility: "visible",
    cursor: "pointer",
    outline: "none",
    boxSizing: "border-box",
    padding: 0,
    margin: 0,
    WebkitFontSmoothing: "antialiased",
    WebkitTapHighlightColor: "rgba(0, 0, 0, 0)",
    transition: "all 0.4s",
    textAlign: "center",
    paddingTop: "31px",
    fontSize: "24px",
    fontFamily: "GTWalsheimProTrial",
    fontWeight: 400,
    color: "#000000",
    lineHeight: 1,
    transform: "translate(0%, 50%)",
    opacity: 0,
  };
  //const yearStyles = isHovered ? yearHovered : year;

  const slide = {
    fontSize: "1.4rem",
    fontFamily: "GTWalsheimProTrial",
    color: "#000000",
    visibility: "visible",
    cursor: "pointer",
    outline: "none",
    boxSizing: "border-box",
    padding: 0,
    margin: 0,
    WebkitFontSmoothing: "antialiased",
    WebkitTapHighlightColor: "rgba(0, 0, 0, 0)",
    transition: "all 0.4s",
    paddingTop: "66px",
    paddingLeft: "47px",
    paddingRight: "47px",
    height: "100%",
    position: "absolute",
    left: "0px",
    top: "0px",
    width: "100%",
    opacity: 0,
  };
  const slideHover = {
    fontSize: "1.4rem",
    fontFamily: "GTWalsheimProTrial",
    color: "#000000",
    visibility: "visible",
    cursor: "pointer",
    outline: "none",
    boxSizing: "border-box",
    padding: 0,
    margin: 0,
    WebkitFontSmoothing: "antialiased",
    WebkitTapHighlightColor: "rgba(0, 0, 0, 0)",
    transition: "all 0.4s",
    paddingTop: "66px",
    paddingLeft: "47px",
    paddingRight: "47px",
    height: "100%",
    position: "absolute",
    left: "0px",
    top: "0px",
    width: "100%",
    opacity: 1,
  };
  //const slideStyles = isHovered ? slideHover : slide;

  const time = {
    visibility: "visible",
    cursor: "pointer",
    outline: "none",
    boxSizing: "border-box",
    padding: 0,
    margin: 0,
    WebkitFontSmoothing: "antialiased",
    WebkitTapHighlightColor: "rgba(0, 0, 0, 0)",
    transition: "all 0.4s",
    fontSize: "48px",
    fontFamily: "Brush Script MT, cursive",
    fontWeight: 400,
    color: "#FFFFFF",
  };
  const dec = {
    fontFamily: "cursive",
    visibility: "visible",
    cursor: "pointer",
    outline: "none",
    boxSizing: "border-box",
    padding: 0,
    margin: 0,
    WebkitFontSmoothing: "antialiased",
    WebkitTapHighlightColor: "rgba(0, 0, 0, 0)",
    transition: "all 0.4s",
    fontSize: "16px",
    fontWeight: "normal",
    color: "#FFFFFF",
    lineHeight: "37px",
    paddingTop: "10px",
  };
  return (
    <div
      style={{
        fontSize: "1.4rem",
        fontFamily: "GTWalsheimProTrial",
        color: "#000000",
        outline: "none",
        boxSizing: "border-box",
        padding: 0,
        margin: 0,
        WebkitFontSmoothing: "antialiased",
        WebkitTapHighlightColor: "rgba(0, 0, 0, 0)",
        paddingTop: "78px",
        paddingBottom: "64px",
      }}
    >
      <div
        style={{
          fontSize: "1.4rem",
          fontFamily: "GTWalsheimProTrial",
          color: "#000000",
          outline: "none",
          boxSizing: "border-box",
          WebkitFontSmoothing: "antialiased",
          WebkitTapHighlightColor: "rgba(0, 0, 0, 0)",
          margin: "auto",
          maxWidth: "100%",
          padding: "0px 15px",
          width: "992px",
        }}
      >
        <div
          style={{
            outline: "none",
            boxSizing: "border-box",
            padding: 0,
            margin: 0,
            WebkitFontSmoothing: "antialiased",
            WebkitTapHighlightColor: "rgba(0, 0, 0, 0)",
            animationFillMode: "both",
            animationDuration: "1.76s",
            fontSize: "61px",
            fontFamily: "GTWalsheimProTrial",
            fontWeight: 400,
            animationDelay: ".4s !important",
            color: "#333",
            textAlign: "center",
            visibility: "visible",
            animationName: "fadeInUp",
          }}
        >
          Company History
